function HomePage() {
  return (
    <>
      <div>
        <h1>
          빙고로 알아보는
          <br /> 나의 <span>진짜!</span> MBTI
        </h1>
        {/* <button>시작하기</button> */}
        <Link to={"/profile"}>시작하기</Link>
      </div>
    </>
  );
}

export default HomePage;
